import React from "react";
import styled from "styled-components";
import rectangle from "./img/Rectangle.png"
import {Link, Route} from 'react-router-dom';
import Pro1st from "./Pro1st";
import Pro2nd from "./Pro2nd";
import Pro3rd from "./Pro3rd";
import Pro4th from "./Pro4th";
import Pro5th from "./Pro5th";
import Pro6th from "./Pro6th";

const TextDiv = styled.div`
  position: absolute;
  left: 35px;
  top: 90px;
  white-space: nowrap;
  font-family: "Noto Sans";
  font-style: normal;
  font-weight: 600;
  font-size: 25px;
  line-height: 34px;
`;

const ScrollDiv = styled.div`
  margin-top: 160px;
  margin-left: 35px;
  overflow: scroll;

  /* 가로 스크롤 */
  overflow: auto;
  white-space: nowrap;

  ::-webkit-scrollbar {
    display: none;
  }
`;

const MenuDiv = styled.div`
  display: inline-block;
  width: 54px;
  height: 54px;
  background: #ffffff;
  border: 2px solid #4c88ff;
  border-radius: 50%;
  text-align: center;
  line-height: 54px;
  margin-right: 10px;

  font-family: Noto Sans;
  font-size: 15px;
  font-weight: 600;
`;

const DetailDiv = styled.div`
  width: 324px;
`;

const ImageDiv = styled.img`
  background-size: cover;
  width: 324px;
  height: 204px;

  margin-top: 100px;
  margin-left: 35px;
`;

const GameTitle = styled.div`
  position: absolute;
  left: 47px;
  margin-top: 2%;
  font-family: "Noto Sans";
  font-style: normal;
  font-weight: 600;
  font-size: 18px;
  line-height: 25px;
  /* identical to box height */

  color: #000000;
`;

const DetailText = styled.div`
  position: absolute;
  height: 20px;
  left: 47px;
  margin-top: 50px;
  font-family: "Noto Sans";
  font-style: normal;
  font-weight: 400;
  font-size: 15px;
  line-height: 20px;

  color: #000000;
`;

const Project = () => {
  const menus = [{ name: "" }];
  return (
    <div>
      <TextDiv>프로젝트</TextDiv>
      <ScrollDiv>
        <MenuDiv><Link to="/">전체</Link></MenuDiv>
        <MenuDiv><Link to="/Pro6th">6기</Link></MenuDiv>
        <MenuDiv><Link to="/Pro5th">5기</Link></MenuDiv>
        <MenuDiv><Link to="/Pro4th">4기</Link></MenuDiv>
        <MenuDiv><Link to="/Pro3rd">3기</Link></MenuDiv>
        <MenuDiv><Link to="/Pro2nd">2기</Link></MenuDiv>
        <MenuDiv><Link to="/Pro1st">1기</Link></MenuDiv>
      <Route>
        <Route path="/Pro6th" element={<Pro6th/>}></Route>
        <Route path="/Pro5th" element={<Pro5th/>}></Route>
        <Route path="/Pro4th" element={<Pro4th/>}></Route>
        <Route path="/Pro3rd" element={<Pro3rd/>}></Route>
        <Route path="/Pro" element={<Pro6th/>}></Route>
        <Route path="/Pro6th" element={<Pro6th/>}></Route>
      </Route>
      </ScrollDiv>
      <DetailDiv>
      <ImageDiv src={rectangle} style={{marginTop: '28px'}}/>
        <GameTitle>게임제목</GameTitle>
        <DetailText>설명</DetailText>
      </DetailDiv>
      <DetailDiv>
      <ImageDiv src={rectangle} />
        <GameTitle>게임제목</GameTitle>
        <DetailText>설명</DetailText>
      </DetailDiv>
      <DetailDiv>
        <ImageDiv src={rectangle} />
        <GameTitle>게임제목</GameTitle>
        <DetailText>설명</DetailText>
      </DetailDiv>
    </div>
  );
};

export default Project;
